  [],\n\t\"revision_timestamp\": \"2015-12-08T21:04:41.192788\",\n\t\"name\": \"namibia-community-based-rangeland-and-livestock-management\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \" n        This is a mixed methods impact
  evaluation that randomly assigned which geographic areas were eligible to receive
  the program.  The quantitative data collection and analysis conducted for the study
  will be complemented by qualitative information.nnInnovations for Poverty Action
  (IPA) has been tasked with a mixed methods evaluation of the Community-Based Rangeland
  and Livestock Management (CBRLM) program, a sub-activity of the Namibia Compact,
  with a major component of the evaluation being a randomized controlled trial (RCT).
  The CBRLM program is a multi-year intervention implemented by GOPA Consortium which
  looks to benefit cattle farmers in the northern part of the country through technical
  assistance in the areas of community development, rangeland management, livestock
  management, livestock marketing, and targeted infrastructure support (including
  substantial investment in water access). At the heart of the program are a series
  of community-based natural resource management strategies that look to mitigate
  persistent u2018tragedy of the commonsu2019 type problems that have the potential
  to negatively impact livelihoods, rangeland, and livestock in the region.nnCurrently,
  however, there is limited rigorous evidence on the effectiveness of community-based
  natural resource management programs of this kind. Expert opinion is divided on
  everything from the sustainability and scalability of the approach to the necessary
  set of enabling conditions. Still, the popularity of community-based interventions
  continues to grow. Therefore, this evaluation represents an excellent opportunity
  to substantially guide policy-making using sound evidence, both in Namibia and in
  other low-to-medium income countries.n      \",\n\t\"license_title\": \"License
